import React from 'react';
import Logo from '../Images/MIS SERVICES REQUEST (1).png';
import Logo2 from '../Images/carsucc';

const Header = () => {
	return (
		<div className='header'>
			<div className='logo'>
				<h1 className='logocolor'>
        <img src={Logo2} alt='logo' width="100" height="100" />
<img src={Logo} alt='logo' />
				</h1>
				<h2 className='logor2'></h2>
			</div>
		</div>
	);
};
export default Header;
